const base64Images = [
    'data:image/png;base64,',
    'data:image/png;base64,',  
    'data:image/png;base64,',
    'data:image/png;base64,',
    'data:image/png;base64,',
    'data:image/png;base64,',
];

function getRandomImage() {
    const randomIndex = Math.floor(Math.random() * base64Images.length);
    return base64Images[randomIndex];
}

